function ContactSocialMedia({url, image, alt}) {
    const imageSrc = require(image)
    return(
        <a href={url}><img className="contact-logo-button" src={require("./src/images/LinkedIn_icon.png")} alt={alt} /></a>
    )
}

export default ContactSocialMedia
